var MediaMatrix = MediaMatrix || {
    location: "jsmediamatrix.js",
    core: {},
    worker: {
        fn:{}
    },
    space:{},
    
    innerproduct: function (v1, v2){
        var sum = 0;
        for (var i = 0; i < v1.length && i < v2.length; i += 1) {
            var value1 = isNaN(v1[i]) ? 0 : v1[i];
            var value2 = isNaN(v2[i]) ? 0 : v2[i];
            sum += (value1 * value2);
        }
        return sum;
    },

    histogram: function (bitmap, colorImpression){
        var colors = colorImpression.colors();
        var pixels = bitmap.data.length / 4;
        var result = new Array(colors.length);
        for (var i = 0; i < result.length; i += 1) {
            result[i] = 0;
        }

        for (var j = 0; j < pixels; j += 1) {
            var r = bitmap.data[j * 4];
            var g = bitmap.data[j * 4 + 1];
            var b = bitmap.data[j * 4 + 2];
            var color = Object.create(MediaMatrix.core.HSVColor);
            color.initWithRGB(r, g, b);
            var near = colorImpression.nearestColor(color);
            result[colorImpression.indexOf(near.toString())] += 1;
        }

        for (var k = 0; k < result.length; k += 1) {
            result[k] = result[k] / pixels;
        }

        return result;
    },
    
    copyBitmap: function (src, dest){
        var pixels = src.data.length / 4;
        var i;
        for (i = 0; i < pixels; i += 1) {
            dest.data[i * 4] = src.data[i * 4];
            dest.data[i * 4 + 1] = src.data[i * 4 + 1];
            dest.data[i * 4 + 2] = src.data[i * 4 + 2];
            dest.data[i * 4 + 3] = src.data[i * 4 + 3];            
        }
    }
};



