MediaMatrix.core.HSVColor = function(){
    var re = /^(\w+\/[\w\.]+)\((\d{1,3}),\s*(\d{1,3}),\s*(\d{1,3})\)$/;
    return {
        _init: function() {
            this.name = null;
            this.r = 0;
            this.g = 0;
            this.b = 0;
            this.h = 0;
            this.s = 0;
            this.v = 0;
            this.hsx = 0;
            this.hsy = 0;
        },
        
        equals: function(o) {
            return this.r == o.r && this.g == o.g && this.b == o.b;
        },

        init: function(colorString) {
            var bits = re.exec(colorString);
            if (bits) {
                this.name = bits[1];
                this.r = parseInt(bits[2]);
                this.g = parseInt(bits[3]);
                this.b = parseInt(bits[4]);
            }
            this.convertRGBtoHSV();
            return this;
        },

        initWithRGB: function(r, g, b){
            this._init();
            this.r = r;
            this.g = g;
            this.b = b;
            this.convertRGBtoHSV();
            return this;
        },

        convertRGBtoHSV: function(){
            var cmax = (this.r > this.g) ? this.r : this.g;
            if (this.b > cmax) {
                cmax = this.b;
            }
            var cmin = (this.r < this.g) ? this.r : this.g;
            if (this.b < cmin){
                cmin = this.b;
            }
            this.v = cmax / 255.0;
            if (cmax != 0) {
                this.s = (cmax - cmin) / cmax;
            } else {
                this.s = 0;
            }
            if (this.s == 0) {
                this.hue = 0;
            } else {
                var redc = (cmax - this.r) /  (cmax - cmin);
                var greenc = (cmax - this.g) / (cmax - cmin);
                var bluec = (cmax - this.b) /  (cmax - cmin);
                if (this.r == cmax) {
                    this.h = bluec - greenc;
                } else if (this.g == cmax) {
                    this.h = 2.0 + redc - bluec;
                } else {
                    this.h = 4.0 + greenc - redc;
                }
                this.h = this.h / 6.0;
                if (this.h < 0) {
                    this.h = this.h + 1.0;
                }
            }
            this.hsx = this.s * Math.cos(2 * Math.PI * this.h);
            this.hsy = this.s * Math.sin(2 * Math.PI * this.h);
        },

        distance: function(color) {
            var xDiff = this.v * this.hsx - color.v * color.hsx;
            var yDiff = this.v * this.hsy - color.v * color.hsy;
            var valueDiff = this.v - color.v;
            return (xDiff * xDiff) + (yDiff * yDiff) + (valueDiff * valueDiff);
        },

        toHex: function () {
            var r = this.r.toString(16);
            var g = this.g.toString(16);
            var b = this.b.toString(16);
            if (r.length == 1) r = '0' + r;
            if (g.length == 1) g = '0' + g;
            if (b.length == 1) b = '0' + b;
            return '#' + r + g + b;
        },

        toString: function () {
            return this.name + "("+ this.r + ","+ this.g + "," + this.b + ")";
        },
        
        toPureString: function () {
            return this.r + ","+ this.g + "," + this.b;
        }

    };
}();


MediaMatrix.core.ColorImpression = function (){
    return {
        _init: function() {
            this.colorString = [];
            this.colorObjects = [];
            this.impressions =[];
        },

        init: function(url) {
            this._init();
            var xhr = new XMLHttpRequest();
            xhr.open("GET", url, false);
            xhr.send(null);
            if (xhr.status === 200 && xhr.responseText) {
                var json = JSON.parse(xhr.responseText);
                this.colorString = json.colorString;
                this.impressions = json.impressions;
                for (var i = 0; i < this.colorString.length; i += 1) {
                    this.colorObjects.push(Object.create(MediaMatrix.core.HSVColor).init(this.colorString[i]));
                }
            } else {
                throw new Error("XMLHttpRequest failed. Status:" + xhr.status +", Response:" + xhr.responseText);
            }
        },

        predefined: function(name) {
            this._init();            
            this.colorString = MediaMatrix.space[name].colorString;
            this.impressions = MediaMatrix.space[name].impressions;
            for (var i = 0; i < this.colorString.length; i += 1) {
                this.colorObjects.push(Object.create(MediaMatrix.core.HSVColor).init(this.colorString[i]));
            }
        },


        initWithColorString: function(colorString) {
            this._init();
            this.colorString = colorString;
            for (var i = 0; i < this.colorString.length; i += 1) {
                this.colorObjects.push(Object.create(MediaMatrix.core.HSVColor).init(this.colorString[i]));
            }
        },

        
        colors: function() {
            return this.colorObjects;
        },

        indexOf: function(colorName) {
            for (var i = 0; i < this.colorString.length; i += 1) {
                if (colorName === this.colorString[i]) {
                    return i;
                }
            }
            throw new Error("Color_Not_Found: " + colorName);
        },
        
        getDominantColor: function(histogram) {
            var i = 0,
            max = 0,
            previous = 0;
            for (i = 0; i < histogram.length; i += 1) {
                max = Math.max(max, histogram[i]);
                if (max == histogram[i]) {
                    previous = i;
                }
            }
            return this.colorObjects[previous];
        },

        histogram: function (bitmap){
            var colors = this.colors(), pixels = bitmap.data.length / 4,
            result = new Array(colors.length), i, color, near;
            
            for (i = 0; i < result.length; i += 1) {
                result[i] = 0;
            }

            for (i = 0; i < pixels; i += 1) {
                color = Object.create(MediaMatrix.core.HSVColor);
                color.initWithRGB(bitmap.data[i * 4], bitmap.data[i * 4 + 1], bitmap.data[i * 4 + 2]);
                near = this.nearestColor(color);
                result[this.indexOf(near.toString())] += 1;
            }

            for (i = 0; i < result.length; i += 1) {
                result[i] = result[i] / pixels;
            }

            return result;
        },
        
        cluster: function(bitmap, selectedColors) {
            var pixels, i, color, near, selected;
            
            pixels = bitmap.data.length / 4;            
            for (i = 0; i < pixels; i += 1) {
                color = Object.create(MediaMatrix.core.HSVColor);
                color.initWithRGB(bitmap.data[i * 4], bitmap.data[i * 4 + 1], bitmap.data[i * 4 + 2]);
                near = this.nearestColor(color);
                
                if (selectedColors === undefined) {
                    selected = true;
                } else {
                    selected = false;
                    for (var j = 0; j < selectedColors.length; j = j+1) {
                        if (near.toString() == selectedColors[j]){
                            selected = true;
                            break;
                        }
                    }
                }
                if (selected) {
                    bitmap.data[i * 4] = near.r;
                    bitmap.data[i * 4 + 1] = near.g; 
                    bitmap.data[i * 4 + 2] =  near.b;              
                } else {
                    bitmap.data[i * 4] = 255;
                    bitmap.data[i * 4 + 1] = 255; 
                    bitmap.data[i * 4 + 2] =  255;                                  
                }                
            }

            return bitmap;
        },

        impression: function(vector) {
            var result = new Array(this.impressions.length);
            for (var i = 0; i < this.impressions.length; i = i+1) {
                var cicVector = this.impressions[i].slice(1);
                var score = MediaMatrix.innerproduct(vector, cicVector);
                result[i] = score;
            }
            return result;
        },

        impressionVectorToObject: function(metadata) {
            var result = new Array(metadata.length);
            for (var i = 0; i < metadata.length; i += 1) {
                result[i] = {
                    "name": this.impressions[i][0],
                    "score": metadata[i]
                };
            }
            result.sort ( function (b1, b2) {
                var diff = b1.score - b2.score;
                if (diff === 0) {
                    diff = (b1.name < b2.name) ? 1 : -1;
                }
                return diff;
            });
            return result.reverse();
        },

        impressionObject: function(vector) {
            var result = new Array(this.impressions.length);
            for (var i = 0; i < this.impressions.length; i = i+1) {
                var name = this.impressions[i][0];
                var cicVector = this.impressions[i].slice(1);
                var score = MediaMatrix.innerproduct(vector, cicVector);
                result[i] = {
                    "name": name,
                    "score": score
                };
            }
            result.sort ( function (b1, b2) {
                var diff = b1.score - b2.score;
                if (diff === 0) {
                    diff = (b1.name < b2.name) ? 1 : -1;
                }
                return diff;
            });
            return result.reverse();
        },

        impressionSize: function() {
            return this.impressions.length;
        },

        nameOf: function(index) {
            return this.impressions[index][0];
        },

        colorSchemeByName: function(name) {
            for (var i = 0; i < this.impressions.length; i += 1) {
                if (name === this.impressions[i][0]) {
                    return this.impressions[i].slice(1);
                }
            }
            throw new Error("ColorScheme_Not_Found: " + name);
        },

        nearestColor: function(color) {
            var min = Number.MAX_VALUE;
            var result = null;
            for (var i = 0; i < this.colorObjects.length; i = i+1) {
                var distance = this.colorObjects[i].distance(color);
                if (distance < min) {
                    min = distance;
                    result = this.colorObjects[i];
                }
            }
            return result;
        },
        
        toImage: function(word) {
            var values = this.colorSchemeByName(word),
            canvas = document.createElement('canvas'),
            context = canvas.getContext('2d'),
            xstart = 0,
            i, width;
            
            canvas.width = 100;
            canvas.height = 50;
            
            for (i = 0; i < values.length; i++) {
                if (values[i] > 0) {
                    context.beginPath();
                    context.fillStyle = this.colorObjects[i].toHex();
                    width = values[i] * canvas.width;
                    context.fillRect(xstart, 0, canvas.width, canvas.height);
                    xstart += width;
                }
            }
            return canvas.toDataURL();
        }
    };
}();

MediaMatrix.worker.fn.analyze = function (args){
    var colorImpression = Object.create(MediaMatrix.core.ColorImpression);
    colorImpression.initWithColorString(args.colors);
    var histogram = colorImpression.histogram(args.bitmap);
    var colors = colorImpression.colors();
    var result = [];
    var i;
    for (i = 0; i < colors.length; i += 1) {
        result.push({
            'color': colors[i].toHex(), 
            'histogram': histogram[i]
        });
    }
    return result;
};

MediaMatrix.worker.fn.analyzeImpression = function (args){
    var colorImpression = Object.create(MediaMatrix.core.ColorImpression);
    colorImpression.predefined(args.space);
    var histogram = colorImpression.histogram(args.bitmap);
    var metadata = colorImpression.impressionObject(histogram);    
    return metadata;
};

MediaMatrix.worker.fn.cluster = function (args){
    var colorImpression = Object.create(MediaMatrix.core.ColorImpression);
    colorImpression.initWithColorString(args.colors);
    return colorImpression.cluster(args.bitmap, args.selectedColors);
};

MediaMatrix.worker.WorkerObject = function() {
    return {        
        url: MediaMatrix.location,
        method: null,
        args: null,
        onmessage: null,
        onerror: null,
        start: function() {
            var worker = new Worker(this.url);
            worker.addEventListener("message", this.onmessage, true);
            worker.addEventListener("error", this.onerror, true);
            worker.postMessage({
                method: this.method,
                args: this.args
            });
        }
    };
}();

